import axios from "axios";

export const addGame = (plot) => {
  var plotString = JSON.stringify(plot);

  axios
    .put("http://localhost:8080/api/games/1", {
      plot: plotString,
    })
    .then((response) => {
      console.log(response);
    })
    .catch((error) => {
      console.log(error);
    });
};
